import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import Button from 'react-bootstrap/Button';
import hmnlogo from '../logoGroup.png';

function NavBar() {
  return (
<>
    <Navbar bg="white" variant="light" height="40" display="flex">
        <Container>
          <Navbar.Brand href="#" className="d-flex justify-content-start">
            <img
              alt=""
              src={hmnlogo}
              className="d-inline-block align-top"
              style={{ height:"28px", margin:"10px"}}     
            />{' '}
            <Button style={{ margin: "10px", border: "1px", color: "rgba(76, 180, 180, 1)"}}>
              BETA</Button>
          </Navbar.Brand>


          <Navbar.Text margin-bottom="20px" className="d-flex justify-content-end">
            <a href="#contact"
              style={{}}
            >Contact Us</a>
          <a href="#login">Member Login</a>
        </Navbar.Text>

        </Container>
      </Navbar>
      </>   

  );
}

export default NavBar;
